  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:34.615643\",\n\t\"name\": \"observations-of-1981-spring-harvest-of-walrus-diomede-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes Pacific walrus harvest
  data that was collected in 1981 in Diomede, Alaska. This year the marine mammal
  division of the Fish and Wildlife Service (FWS) conducted their second study of
  the walrus during the spring hunting season in the village of Diomede. Again, as
  in last year, the FWS imposed no limits on the number of walrus that could be taken
  by the natives. The objectives of this springs' study were: to document the total
  number and sex of walruses harvested; to sample the age and tusk length of animals
  harvested; to sample several animals for contaminant levels; to document any additional
  information pertinent to the life history of the walrus; and subsistence requirements
  of the natives.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
